import styled from '@emotion/styled'
import { AppBar, Button, DialogActions, DialogContent, Grid, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

const Forgot_password = () => {
    
// header for forgot password
    const Capp = styled(AppBar)({
        backgroundColor: "#9B3C21",
      
      })



  return (
    <div>

{/* pang break */}
        <br/>
        <br/>
        <br/>
        <br/>
        <br/>
        <br/>

        {/* Whole container */}
        <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        spacing={2}
        >

            {/* Item container */}
            <Grid item md={8} style={{ width: 200}}>
                
                {/* Header */}
                <Capp position='static'>
                        <Typography variant='h5' margin={2}>Forgot password</Typography>
                </Capp>
                <Grid         
                container
                direction="column"
                justifyContent="center"
                alignItems="center"
                padding={2}
                style={
                    {
                        backgroundColor: "white",
                        border: "solid 2px black"
                    }
                }>


                </Grid>
                
            </Grid>

        </Grid>
          
    </div>
  )
}


export default Forgot_password
